"use strict";

(function () {
    angular.module("operator-landing").controller("signupModalController", signupModalController);

    signupModalController.$inject = ['$scope', 'signupModalService', '$uibModal', '$timeout', 'OperatorFactory', '$state', '$rootScope'];

    function signupModalController($scope, signupModalService, $uibModal, $timeout, OperatorFactory, $state, $rootScope) {
        var vm = this;

        vm.params = {
            signupForm: true,
            signupThanks: false
        };

        vm.signup = function () {

            var formData = {
                init_firstname: vm.init_firstname,
                init_lastname: vm.init_lastname,
                operator_name: vm.operator_name,
                email: vm.email,
                phone: vm.phone,
                zip: vm.zip
            };

            OperatorFactory.newOperator(formData);

            vm.params.contactUsForm = false;
            vm.params.thanks = true;

            setTimeout(function () {
                $rootScope.modalInstance.close();
            }, 5000);
        };
    }
})();
